import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
            <button onClick = {() => selectData()}>조회</button>
        </div>
      </header>
    </div>
  );
}

export default App;
